g2:c.PROCEDURE.g2:a.TEXT:
_opcs-startup (Object: class gfr-startup-object, InitialStartup: truth-value, Modules: class symbol-list, Client: class object)
 
  devstuffName: symbol = the symbol gdev-internals-workspaces; 
  intstuffName: symbol = the symbol int-internals-workspaces;
  Err: class error;

begin

  {--- No startup required for module restart }
  if not(InitialStartup) then return;

  {--- For devstuff development environment } 
  if the item named by devstuffName exists then
    insert opcs-private at the end of the item-list named by devstuffName;

  if the item named by intstuffName exists then
    insert opcs-private at the end of the item-list named by intstuffName;

end on error (Err)
  call gerr-dispatch (Err, this procedure, gfr-default-window);
end

_opcs-display-title-bar (WKSP: class kb-workspace)
Lable, Title-text: text;
Title: class uil-dialog-title;
begin
    if there exists a uil-dialog-title Title upon WKSP then
    begin
        Title-text = the message-contents of Title;
        call uil-delete-grobj-method (Title);
        Title = call uil-create-styled-dialog-title ("", the symbol medium, Title-text, the symbol none);
        conclude that the uil-title-button-behaviour-enabled of Title = true;
        conclude that the uil-title-button-callback of Title = the symbol opcsrui-dismiss-browser;
        conclude that the uil-justification of Title = the symbol left;
        conclude that the configuration of Title = the symbol _opcsrui-dialog-title-bar-configuration;
        call uil-manage-grobj-method (Title, WKSP, the symbol none, 0, 0);
        call uil-justify-dialog-title (Title, WKSP);
        call g2-drop-item-to-bottom (Title);
    end;
    make WKSP transient;
end

opcs-user-login(W: class ui-client-item)
begin
    {inform the operator for the next 3 minutes that "The base window or a telewindow has logged in";
    call g2-beep(W);
     start gms-create-menu (W);}
    call _opcs-show-copyright-ws (W);
end

g2:c.METHOD.g2:a.TEXT:
twm-display-screen (source: class sc-browser-template , target: class sc-browser-template , window: class ui-client-item, xPos: integer, yPos: integer, UsePos: truth-value) = (class kb-workspace)
aTMPLW: class twm-template-widget;
error-name: symbol; error-text: text; 
BrowserQueue : class gqs-queue ;
ViewManager: class gqsv-tabular-view-manager ; 
wksp: class kb-workspace;
display-proc-name: symbol;
display-proc: class procedure;
history: class item-list = the twm-workspace-history of the twm-window-mirror that is the-twm-mirror-of window;
Sheet, View: item-or-value; 

begin
    if there exists a kb-workspace wksp such that
        (wksp is a member of the item list history and
         wksp is twm-targeted-by target and wksp is twm-sourced-by source)
        {find whether the right source-target combination is already displayed on the screen}
        then {remove wksp from the item list history}
    begin
        conclude that wksp is twm-displayed-on window; 
        if there exists an twm-template-widget aTMPLW connected to target and the twm-display-procedure of aTMPLW has a current value then
        begin
             display-proc-name = the twm-display-procedure of aTMPLW; 
             if there exists a procedure display-proc named by display-proc-name then
                 call display-proc(source,target,wksp,window);
        end; 
    end 
    else
    begin
        if there exists an twm-template-widget aTMPLW connected to target then
        begin 
            BrowserQueue {Queue created with proper subscription} = call devu-clone(target);

            call gfr-initialize (BrowserQueue, window); 

            call twm-transfer-to-repository (BrowserQueue , window);
 
            ViewManager = call gqs-launch-view (BrowserQueue, window);
            
            Sheet, View = call gqsv-get-spreadsheet-and-view-from-manager (ViewManager, window); 
            if View is an item then
            begin 
                wksp = the workspace of View; 
                conclude that wksp is now twm-targeted-by target;
                conclude that wksp is now twm-sourced-by source;
                insert wksp at the beginning of the item list history;
                conclude that wksp is twm-displayed-on window; 
        
                call sc-initialize (BrowserQueue, ViewManager, wksp);
            end;

            if aTMPLW exists and the twm-display-procedure of aTMPLW has a current value then
            begin
                display-proc-name = the twm-display-procedure of aTMPLW; 
                if there exists a procedure display-proc named by display-proc-name then
                    call display-proc(source,target,wksp,window) 
            end;
        end;
    end;

{980505  WSM    Added per bug HQ-1875690.}
if UsePos then
    show wksp on window with its top left corner xPos units to the right of and yPos units below the top left corner of the screen
else
    show wksp on window;

{980505  WSM    Added this procedure call.  Refer to bug HQ-1794254.}
call _opcs-display-title-bar (wksp);
return wksp 
end on error (error-name, error-text ) 
    start devu-error-handler (this procedure, this procedure, devu-system-category, devu-high-priority,error-name, error-text, devu-error-lifetime);
    return the subworkspace of _opcs-default-twm-display-screen-ws;
end

g2:c.PROCEDURE.g2:a.TEXT:
opcs-set-browser-filter-data (source-twmtmp: class item, target-twmtmp: class item, window: class ui-client-item, xPos: integer, yPos: integer, target-obj: class object, filter-class: symbol)
kbws: class kb-workspace; 
filter : class sc-filter;
ViewManager: class gqs-view-manager;
BrowserQueue: class sc-browser-queue; 
Title: class uil-dialog-title;
begin 
kbws = call TWM-DISPLAY-SCREEN (source-twmtmp, target-twmtmp, window, xPos, yPos, true);
if there exists a uil-dialog-title Title upon kbws then
begin
    call uil-justify-dialog-title (Title, kbws);
    call g2-drop-item-to-bottom (Title);
end;
ViewManager, BrowserQueue = call sc-get-manager-and-queue-from-browser-view-ws (kbws, window); 
for filter = each sc-filter upon kbws do
    if the class of filter = filter-class then begin
        call set-filter-data (filter, target-obj);
        if the sc-active of filter then call sc-refresh (Filter) else
            call sc-toggle (filter);
        exit if true;
    end;
end;
end

_opcs-show-copyright-ws(WIN: class ui-client-item)
WS: class kb-workspace = the subworkspace of _opcs-copyright-notice; 
begin
     show WS on WIN at full scale with its top center 90 units below the top center of the screen;
wait for 10 seconds;
hide WS on WIN;
end

opcs-get-msg-colors (Msg: class smh-transient-message, KeyOrAttribute: symbol) = (symbol, symbol, symbol)
PriBackColor: symbol;
PriTxtColor: symbol;
begin
if the smh-priority of Msg > the array-length of opfom-priority-alarm-colors then
    PriBackColor = opfom-default-priority-color 
else
    PriBackColor = opfom-priority-alarm-colors [the smh-priority of Msg - 1];
if the smh-priority of Msg > the array-length of opfom-priority-alarm-text-colors then
    PriTxtColor = {opfom-default-priority-color} opfom-default-priority-text-color 
else 
    PriTxtColor = opfom-priority-alarm-text-colors [the smh-priority of Msg - 1]; 
    if the smh-acknowledgement-status of Msg is unacknowledged then
        return PriBackColor, PriTxtColor, the symbol black else
        return the symbol white, PriTxtColor, PriBackColor;
end
